class table{constructor(length,hashElement){this.data=new Array(length),this.hashElement=hashElement}set(object){this.key=Object.keys(object)[this.hashElement];let value=object[this.key],index=this.hash(value);if(null==this.data[index])this.data[index]=object;else if(null==this.data[index].length){let pastData=this.data[index];this.data[index]=[pastData],this.data[index].push(object)}else this.data[index].push(object)}get(data){let index=this.hash(data);if(null==this.data[index].length)return this.data[index];{let arr=this.data[index];for(let i=0;i<arr.length;i++){let element=arr[i],value=element[this.key];if(0==data.localeCompare(value))return element}}}hash(element){let indexNum=0;for(let i=0;i<element.length;i++)indexNum+=element.charCodeAt(i);return indexNum%this.data.length}}